import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {Header, Footer} from './components/base';
import Blog from './components/blog';


ReactDOM.render(
  <React.StrictMode>
    <Header />
    <Blogs />
    <Footer />
  </React.StrictMode>,
  document.getElementById('root')
);

